import { useEffect, useState } from "react";
import axios from "axios";

export default function ProductList(props) {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8080/api/products')
            .then(response => {
                setProducts(response.data);
            })
            .catch(error => {
                console.log(error);
            });
    }, []);

    return (
        <>
            <div>
                <h2>LIST PRODUCT</h2>
                <table border={1}>
                    <thead>
                    <tr>
                        <th>STT</th>
                        <th>NAME</th>
                        <th>PRICE</th>
                        <th>PRICE SALE</th>
                        <th>CATEGORY</th>
                        <th>VIEW</th>
                        <th>PURCHASE</th>
                        <th>STATUS</th>
                        <th>TIME MAKE</th>
                        <th>IMG</th>
                        <th colSpan={2}>ACTION</th>
                    </tr>
                    </thead>
                    <tbody>
                    {products.map((c, index) => (
                        <tr key={index}>
                            <td>{index + 1}</td>
                            <td>{c.name}</td>
                            <td>{c.price}</td>
                            <td>{c.priceSale}</td>
                            <td>{c.category.name}</td>
                            <td>{c.view}</td>
                            <td>{c.purchase}</td>
                            <td>{c.status}</td>
                            <td>{c.timeMake}</td>
                            <td>{c.image}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </>
    );
}
